import React from 'react'
import TeamImg from "../../images/DarkThemeIcon.png";
export default function TeamCard() {
  return (
    <div className='team_box'>
<div className='team_img'>
<img src={TeamImg} alt="" />
</div>
<div className='team_content'>
    <h3>Muhammad Taha</h3>
    <p>Full stack web developer</p>
</div>
    </div>
  )
}
